INSERT INTO `services` VALUES (6,'Digital Marketing','<p>Digital marketing is on the path of becoming the core element of every successful business that exists.Hence, the significance of digital marketing cannot be denied by any smart businessman.</p>\r\n\r\n<p>As the best digital marketing company in Kerala, we can take your company to heights, giving you greater online visibility, branding, traffic, and leads which results in more sales. Reaching a larger audience and the right audience is what can help you achieve that.</p>','1660720362.jpg',1,'2022-08-16 20:12:42','2022-08-18 13:39:39'),(7,'Search Engine Optimization','<p>In an increasingly connected world and a crowded market, how can your brand get the visibility it needs? With Google unleashing algorithm updates by the thousands every year and a constantly evolving landscape, SEO is not just about achieving a top page ranking, it&rsquo;s about sustaining that position. &nbsp;Are you wondering how to get more traffic, sales, and profits for your business through your website? Effective SEO strategies are the key to this. Ambiers is the Best SEO Company in Kerala that helps businesses boost their growth through advanced SEO techniques.</p>\r\n\r\n<p>Under our SEO services, we optimize the content of your website in the most effective way.The motive of our SEO service is to help your website rank in search results.Our SEO includes full-fledged content marketing, link-building process, analysis and reporting..</p>','1660720457.jpg',1,'2022-08-16 20:14:17','2022-08-16 20:18:58'),(8,'Social Media Marketing','<p>Social Media empowers you to reach your target audience on various platforms for different purposes such as - career building platforms like Linkedin, general socializing like Facebook, Instagram or absolute content-driven like Twitter. Social media marketing is the use of these social media platforms to connect with the relevant audience to.</p>\r\n\r\n<p>Social media is considered the second-most effective form of digital marketing, yet more than one-third of businesses have no social media presence at all. This is largely due to small businesses not having the time or resources to invest in social media marketing.Organic growth with targeted campaigning helps you increase brand impact in global communities. We will help you make a difference to the world on social media with our work.</p>\r\n\r\n<p>We offer extensive SMM services tailored for your unique requirements, with the ability to induce significant changes in the shortest time possible. We&rsquo;re capable of thinking from the client&rsquo;s perspective and offer the latest trends in SMM to help you stay on top of your game.</p>','1660720487.jpg',1,'2022-08-16 20:14:47','2022-08-16 20:20:00'),(9,'Google Ads','<p>If you want to reach new customers online, then advertising with Google Ads might be right for you.Google Ads is a product that you can use to promote your business, help sell products or services, raise awareness, and increase traffic to your website.Online advertising lets you target your ads to the type of customers you want, and filter out those you don&#39;t. When you advertise online with Google Ads, you can use different targeting methods to reach potential customers right when they&#39;re searching for your products or services.</p>','1660720513.jpg',1,'2022-08-16 20:15:13','2022-08-16 20:20:44'),(10,'Graphic Designing','<p>The goal of our graphic design wizards is to dazzle with design and make every creation beautiful. Every single creative follows the theme and style guide of your brand.</p>\r\n\r\n<p>Our core team of graphic designers has the necessary skills, expertise, and creativity to bring out awesome designs for you. Our team also actively engages in learning and upskilling themselves to stay the best always.</p>','1660720531.jpg',1,'2022-08-16 20:15:31','2022-08-29 12:20:20'),(11,'Website Designing','<p>A website is a branding tool, a business device, and a destination to drive client conversions. A visually appealing website acts as an accelerator for your business growth, whereas a poor website can harm the brand image, affecting the lead conversions in the process.With several years of experience, we at Ambiers the website development company in Kerala, create just the perfect websites for your business to flourish and grow like never before. We are one of the best web development companies in Kerala, with a special emphasis on compelling visual hierarchy and immaculate user experience to drive high-ranking outcomes.</p>\r\n\r\n<p>If you are looking for a simple yet creative basic type of website, then Static Website is for your business. With fixed pages and content, these websites are the quickest to create and are up and running the very next day. The pages are coded in HTML and are easily manageable by non-tech users.</p>\r\n\r\n<p>Unlike a static website, dynamic websites are functional and technically coded with scripting languages such as JavaScript, PHP, or ASP. These websites are designed to rely on both the client-side and server-side. These websites are more interactive, complex as well as versatile in terms of building and design.</p>\r\n\r\n<p>If you are running a company or a business either on a small scale or on a large scale, it is important to create an online image as well for the success of your business. Web designing is one such step on the ladder to your success. When you are creating an online portal for your business, it means that you want your business to grow and be available to users all round the clock.</p>','1660720567.jpg',1,'2022-08-16 20:16:07','2022-08-16 20:22:38'),(12,'App Development','<p>In a world dominated by portable mobile devices,it can be difficult to find the finest mobile app development firm in Kannur to design your app. A necessary consideration is having a mobile application for your company.</p>\r\n\r\n<p>Android app development offers tremendous strategic and operational benefits. Therefore, regardless of their size, businesses are leveraging android app development to grow their business and improve their revenues.</p>\r\n\r\n<p>The skilled experts have several years of expertise to develop any complex app with advanced features. Being the leading mobile app development company in Kerala, we have successfully delivered 20+ projects. Our clients are happy to receive their products on time with unique solutions.</p>','1661753274.jpg',1,'2022-08-29 13:07:54','2022-08-30 23:13:33');
